    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE NOT col2 = - col2 OR NOT - col0 * + + 85 + - col2 + - - 79 <> + ( - col2 );
  - name: tab0

outputs:
  - name: q11891.out
    data: |
      15	81	47
      87	21	10
      97	1	99
